import logo from './logo.svg';
import './App.css';

function App() {
  // Initialize a 9x9 grid with all zeros
  const grid = Array(9).fill().map(() => Array(9).fill(0));

  return (
    <div className="App">
      <table>
        <tbody>
          {grid.map((row, i) => (
            <tr key={i}>
              {row.map((value, j) => (
                <td key={j}>{value}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
